import React from "react";
import $ from "jquery";

export default function Navbar() {

  return (
   <header className="second-namebar">
    <ul>
      <li><a href="">Home</a></li>
      <li><a href="">About Us</a></li>
      <li><a href="">Blogs</a></li>
      <li><a href="">Contact Us</a></li>
    </ul>
   </header>
  );
}
